import { QUERY_PROJECTS } from "../../utils/queries";
import { useQuery } from "@apollo/client";
import { ExploreContainer, ExplorerCard, ExploreCardAuthor, ProjectAuthor, PostTime } from "./Common.js";
import { Link } from "react-router-dom";
import Earth from "../../assets/earth.png";

function ExploreCard(props) {
  const { loading, data } = useQuery(QUERY_PROJECTS);
  const projects = data?.projects || [];

  console.log(data);

  return (
    <ExploreContainer>
      {projects.map((projects) => (
        <ExplorerCard key={projects._id}>
          <ExploreCardAuthor>
            <ProjectAuthor>@{projects.projectAuthor}</ProjectAuthor>
            <h4 className="post__time">{projects.createdAt}</h4>
          </ExploreCardAuthor>
          <div className="explore__card__title">
            {/* <img className="explore__image" src={Earth} /> */}
            <h3 className="project__title">
              <Link to={`/projects/${projects._id}`}>
                {projects.projectTitle}
              </Link>
            </h3>
          </div>
        </ExplorerCard>
      ))}
    </ExploreContainer>
  );
}

export default ExploreCard;
